import React from 'react';

function CreatePostForm() {
    return (
    <div className="wrapper">
        <h2>Create a new post</h2>
        <form>
            <input type="text" className="title" placeholder="Title"></input>
            <input type="text" className="content" placeholder="content" style="height: 130px"></input>
            <input type="text" className="author"></input>
            <input type="text" className="tags"></input>
        </form>
    </div>
    );
}

export default CreatePostForm;
